bool dsp_is_power_of_two(int x)
{
    return (x != 0) && ((x & (x - 1)) == 0);
}

static const int add_rount_mult = 0x7fff;
static const int mult_shift_const = 0x7fff; // Used to shift data << 15

bool dsps_bit_rev_sc16_ansi(int16_t *data, int N)
{
    if (!dsp_is_power_of_two(N)) {
        return false;
    }
    
    int j, k;
    uint32_t temp;
    uint32_t* in_data = (uint32_t*)data;
    j = 0;
    for (int i = 1; i < (N - 1); i++) {
        k = N >> 1;
        while (k <= j) {
            j -= k;
            k >>= 1;
        }
        j += k;
        if (i < j) 
        {
            temp = in_data[j];
            in_data[j] = in_data[i];
            in_data[i] = temp;
        }
    }
    return true;
}

bool dsps_fft2r_sc16_ansi_(int16_t *data, int N, int16_t* sc_table)
{
    if (!dsp_is_power_of_two(N)) {
        return true;
    }

	int ie, ia, m;
	sc16_t cs;// c - re, s - im
	sc16_t m_data;
	sc16_t a_data;

	ie = 1;
	for (int N2 = N / 2; N2 > 0; N2 >>= 1) {
		ia = 0;
		for (int j = 0; j < ie; j++) {
			cs.re = sc_table[2*j];
			cs.im = sc_table[2*j+1];

			for (int i = 0; i < N2; i++) {
				m = ia + N2;

				m_data.re = data[2*m];
				m_data.im = data[2*m+1];

				a_data.re = data[2*ia];
				a_data.im = data[2*ia+1];

				sc16_t m1;
				int32_t result = a_data.re*mult_shift_const; 
				result -= (int32_t)cs.re*(int32_t)m_data.re + (int32_t)cs.im*(int32_t)m_data.im;
				result += add_rount_mult;
				result = result >> 16;
				m1.re = (int16_t)result;

				result = a_data.im *mult_shift_const;
				result -= ((int32_t)cs.re*(int32_t)m_data.im - (int32_t)cs.im*(int32_t)m_data.re);
				result += add_rount_mult;
				result = result >> 16;
				m1.im = (int16_t)result;

				data[m*2] = m1.re;
				data[m*2+1] = m1.im;

				sc16_t m2;
				result = a_data.re *mult_shift_const;
				result += (int32_t)cs.re*(int32_t)m_data.re + (int32_t)cs.im*(int32_t)m_data.im;
				result += add_rount_mult;
				result = result >> 16;
				m2.re = (int16_t)result;
				
				result = a_data.im *mult_shift_const;
				result += (int32_t)cs.re*(int32_t)m_data.im - (int32_t)cs.im*(int32_t)m_data.re;
				result += add_rount_mult;
				result = result >> 16;
				m2.im = (int16_t)result;
				data[ia*2] = m2.re;
				data[ia*2+1] = m2.im;

				ia++;
			}
			ia += N2;
		}
		ie <<= 1;
	}
	return false;
}